import "./App.css";
import theme from "./theme";
import { ThemeProvider } from "@material-ui/core/styles";
import SignIn from "./pages/home-page";
import Container from '@material-ui/core/Container';



function App() {
  return (

    <ThemeProvider theme={theme}>
       <Container>
      <Switch>
      <Route path="/" exact>
      <SignIn></SignIn>
      </Route>
      </Switch>
      </Container>
    </ThemeProvider>
  );
}

export default App;
